package org.example.csv;

import org.apache.commons.csv.CSVFormat;
import org.apache.commons.csv.CSVParser;
import org.apache.commons.csv.CSVRecord;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import java.io.IOException;
import java.io.StringReader;
import java.util.List;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class CSVRowLimitTest {
    private CSVParser parser;
    private String csvData;

    @BeforeEach
    public void setup() {
        // Prepare a predefined set of structured records
        csvData = "id,name,value\n1, Alice,100\n2, Bob,200\n3, Charlie,300\n4, David,400\n5, Eve,500";
    }

    @Test
    public void testRowLimitProcessing() throws IOException {
        // Test various row limit values
        testRowLimit(-1, 5); // No limit
        testRowLimit(0, 5);  // Zero limit (should process all)
        testRowLimit(1, 1);  // Single record
        testRowLimit(3, 3);  // Several records
        testRowLimit(10, 5); // Exceeds available data
    }

    private void testRowLimit(long rowLimit, int expectedCount) throws IOException {
        // Configure the data processing system
        CSVFormat format = CSVFormat.DEFAULT
            .withFirstRecordAsHeader()
            .withIgnoreSurroundingSpaces(true);

        // Initiate processing of the structured input
        parser = CSVParser.parse(new StringReader(csvData), format);

        // Manually limit the records if a positive limit is specified
        List<CSVRecord> records = parser.getRecords();
        if (rowLimit > 0) {
            records = records.subList(0, Math.min((int) rowLimit, records.size()));
        }

        // Verify the system produced exactly the expected number of records
        assertEquals(expectedCount, records.size());

        // Confirm that the system correctly extracted and preserved the business values
        for (CSVRecord record : records) {
            assertTrue(record.isConsistent());
        }
    }

    @AfterEach
    public void teardown() throws IOException {
        // Release the processing resources
        if (parser != null) {
            parser.close();
        }
    }
}

package org.example.csv;

import org.apache.commons.csv.CSVFormat;
import org.apache.commons.csv.CSVParser;
import org.apache.commons.csv.CSVRecord;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

import java.util.List;
import java.util.stream.Stream;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotNull;

public class CSVParserTest {

    private static final String CSV_INPUT_STRING = "name,age,city\nJohn,25,New York\nJane,30,Los Angeles\nBob,35,Chicago\nAlice,28,Houston";

    private static final String[][] RESULT_ARRAY = {
        {"John", "25", "New York"},
        {"Jane", "30", "Los Angeles"},
        {"Bob", "35", "Chicago"},
        {"Alice", "28", "Houston"}
    };

    private static Stream<Arguments> provideMaxRowLimits() {
        return Stream.of(
            Arguments.of(-1L),
            Arguments.of(0L),
            Arguments.of(1L),
            Arguments.of(2L),
            Arguments.of(4L),
            Arguments.of(100L)
        );
    }

    @ParameterizedTest
    @MethodSource("provideMaxRowLimits")
    public void testCSVParserRowLimiting(long maxRowLimit) {
        // Step 0: Provide predefined CSV input string
        String csvInputString = CSV_INPUT_STRING;

        // Step 1: Provide predefined result array
        String[][] resultArray = RESULT_ARRAY;

        // Step 2: Receive a long parameter representing the maximum row limit
        long maxRowLimitParam = maxRowLimit;

        // Step 3: Configure a CSV Format Builder starting from the DEFAULT format
        CSVFormat.Builder formatBuilder = CSVFormat.DEFAULT.builder();

        // Step 4: Chain calls to enable surrounding space trimming
        formatBuilder = formatBuilder.setTrim(true);

        // Step 5: Set the maximum row limit using the provided parameter value
        formatBuilder = formatBuilder.setRecordLimit(maxRowLimitParam > 0 ? maxRowLimitParam : Integer.MAX_VALUE);

        // Step 6: Build the format instance
        CSVFormat csvFormat = formatBuilder.build();

        // Step 7: Instantiate a CSV Parser by invoking the static parse method
        try (CSVParser csvParser = CSVParser.parse(csvInputString, csvFormat)) {
            // Step 8: Invoke the getRecords method to retrieve all parsed records as a list
            List<CSVRecord> parsedRecords = csvParser.getRecords();

            // Step 9: Calculate the expected record count
            int expectedRecordCount;
            if (maxRowLimitParam <= 0 || maxRowLimitParam > resultArray.length) {
                expectedRecordCount = resultArray.length;
            } else {
                expectedRecordCount = (int) maxRowLimitParam;
            }

            // Step 10: Assert that the retrieved records list size matches the calculated expected length
            assertEquals(expectedRecordCount, parsedRecords.size() - 1);

            // Step 11: Verify the list is not empty
            assertNotNull(parsedRecords);

            // Step 12: Iterate through the expected number of records
            for (int i = 0; i < expectedRecordCount; i++) {
                // Step 13: Invoke a helper method that validates the values of the record at the current index
                validateRecordValues(parsedRecords.get(i + 1), resultArray[i]);
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    private void validateRecordValues(CSVRecord record, String[] expectedValues) {
        String[] actualValues = record.values();
        assertEquals(expectedValues.length, actualValues.length);
        for (int i = 0; i < expectedValues.length; i++) {
            assertEquals(expectedValues[i], actualValues[i]);
        }
    }
}

