    private static final String CSV_INPUT = "a,b,c\r\n1,2,3\r\nx,y,z";
    private static final String CSV_INPUT_1 = "a,b,c\r\n1,2,3\r\nx,y,z";
    private static final String CSV_INPUT_2 = "a,b,c\r\n1,2,3\r\nx,y,z";
    private static final String[][] RESULT = {{"a", "b", "c"}, {"1", "2", "3"}, {"x", "y", "z"}};
    private static final String CSV_INPUT_NO_COMMENT = "A,B\r\n1,2\r\n";
    private static final String CSV_INPUT_HEADER_COMMENT = "# header comment\r\nA,B\r\n1,2\r\n";
    private static final String CSV_INPUT_HEADER_TRAILER_COMMENT = "# header comment\r\nA,B\r\n1,2\r\n# trailer comment\r\n";
    private static final String CSV_INPUT_MULTILINE_HEADER_TRAILER_COMMENT = "# multi-line\r\n# header comment\r\nA,B\r\n1,2\r\n# multi-line\r\n# trailer comment\r\n";
    private static final CSVFormat FORMAT_AUTO_HEADER = CSVFormat.DEFAULT.builder().setCommentMarker('#').setHeader().get();
    private static final CSVFormat FORMAT_EXPLICIT_HEADER = CSVFormat.DEFAULT.builder().setCommentMarker('#').setHeader("A", "B").setSkipHeaderRecord(true).get();
    private static final CSVFormat FORMAT_EXPLICIT_HEADER_NOSKIP = CSVFormat.DEFAULT.builder().setCommentMarker('#').setHeader("A", "B").get();

    @ParameterizedTest
    @ValueSource(longs = { -1, 0, 1, 2, 3, 4, Long.MAX_VALUE })
    public void testCSVParserWithMaxRows(long maxRows) throws IOException {
        try (CSVParser parser = CSVParser.parse(CSV_INPUT, CSVFormat.DEFAULT.builder().setIgnoreSurroundingSpaces(true).setMaxRows(maxRows).get())) {
            List<CSVRecord> records = parser.getRecords();
            long expectedLength = maxRows <= 0 || maxRows > RESULT.length ? RESULT.length : maxRows;
            Assertions.assertEquals(expectedLength, records.size());
            Assertions.assertFalse(records.isEmpty());
            for (int i = 0; i < expectedLength; i++) {
                assertValuesEquals(RESULT[i], records.get(i));
            }
        }
    }

    private void assertValuesEquals(String[] expected, CSVRecord actual) {
        for (int i = 0; i < expected.length; i++) {
            Assertions.assertEquals(expected[i], actual.get(i));
        }
    }
}

