package org.example.csv;

import org.apache.commons.csv.CSVFormat;
import org.apache.commons.csv.CSVParser;
import org.apache.commons.csv.CSVRecord;
import org.junit.jupiter.api.Test;
import java.io.File;
import java.io.IOException;
import java.nio.charset.Charset;
import java.util.Iterator;

import static org.junit.jupiter.api.Assertions.*;

public class CsvProcessingTest {

    @Test
    public void testProcessCsvWithDefaultFormatting() throws IOException {
        // Step 0: Locate the sample data file in test resources
        // For this test, we'll simulate the file presence by creating a temporary file
        File sampleDataFile = File.createTempFile("sample", ".csv");
        java.io.FileWriter writer = new java.io.FileWriter(sampleDataFile);
        writer.write("Name,Age,City\nJohn,30,New York\nJane,25,Los Angeles\n");
        writer.close();

        // Step 1: Configure the system to read the file using default charset and format
        CSVParser parser = CSVParser.parse(
            sampleDataFile,
            Charset.defaultCharset(),
            CSVFormat.DEFAULT
        );

        // Step 2: Explicitly apply default formatting rules
        CSVFormat defaultFormat = CSVFormat.DEFAULT;

        // Step 3: Initialize the data reader with default formatting conventions
        CSVParser initializedParser = parser;

        // Step 4: Process the entire file by iterating through each record
        Iterator<CSVRecord> recordIterator = initializedParser.iterator();
        int recordCount = 0;
        boolean allRecordsValid = true;

        while (recordIterator.hasNext()) {
            CSVRecord record = recordIterator.next();
            recordCount++;

            // Step 5: Confirm that every extracted record contains valid information
            if (!record.isConsistent()) {
                allRecordsValid = false;
                fail("Record at index " + (recordCount - 1) + " is not consistent");
            }

            // Step 6: Verify that no parsing failures or empty results occurred
            for (int i = 0; i < record.size(); i++) {
                String value = record.get(i);
                if (value == null || value.trim().isEmpty()) {
                    fail("Empty or blank value found in record at index " + (recordCount - 1) + ", column " + i);
                }
            }
        }

        assertTrue(allRecordsValid, "All records should be valid");
        assertTrue(recordCount > 0, "At least one record should be present in the file");

        // Step 7: Ensure the system properly releases the file handle and associated resources
        initializedParser.close();

        // Step 8: Confirm that no resource leaks are detected
        assertTrue(initializedParser.isClosed(), "Parser should be closed to avoid resource leaks");

        // Clean up
        sampleDataFile.delete();
    }
}

