    @ParameterizedTest
    @MethodSource("provideMaxRowLimits")
    public void testCSVParserRowLimit(long maxRowLimit) throws IOException {
        // Setup: Create a CSV string with a header and three data rows
        String csvString = "name,age,city\nJohn,25,New York\nJane,30,Los Angeles\nBob,35,Chicago";
        StringReader reader = new StringReader(csvString);

        // Configure CSV Format with the provided maxRowLimit
        CSVFormat format = CSVFormat.DEFAULT.builder()
                .setHeader()
                .setMaxRows(maxRowLimit)
                .build();

        // Parse the CSV and collect records
        try (CSVParser parser = CSVParser.parse(reader, format)) {
            List<CSVRecord> records = parser.getRecords();
            assertNotNull(records, "Records list should not be null");

            // Validate records based on the maxRowLimit
            if (maxRowLimit <= 0 || maxRowLimit > 2) {
                CSVRecord thirdRecord = records.get(2);
                validateRecordValues(thirdRecord, new String[]{"Bob", "35", "Chicago"});
            }
            if (maxRowLimit <= 0 || maxRowLimit > 1) {
                CSVRecord secondRecord = records.get(1);
                validateRecordValues(secondRecord, new String[]{"Jane", "30", "Los Angeles"});
            }
            CSVRecord firstRecord = records.get(0);
            validateRecordValues(firstRecord, new String[]{"John", "25", "New York"});
        }
    }

    private static void validateRecordValues(CSVRecord record, String[] expectedValues) {
        String[] actualValues = record.toMap().values().toArray(new String[0]);
        assertEquals(expectedValues.length, actualValues.length, "Record should have the expected number of values");
        for (int i = 0; i < expectedValues.length; i++) {
            assertEquals(expectedValues[i], actualValues[i], "Value at index " + i + " should match");
        }
    }

    private static Stream<Arguments> provideMaxRowLimits() {
        return Stream.of(
                Arguments.of(-1L),
                Arguments.of(0L),
                Arguments.of(1L),
                Arguments.of(2L),
                Arguments.of(3L),
                Arguments.of(Long.MAX_VALUE)
        );
    }
}

