public class CSVParserTest1 {

    private static final String TEXT_SOURCE = "value1,value2,value3\nvalue4,value5,value6\nvalue7,value8,value9";

    @ParameterizedTest
    @ValueSource(longs = {0, 1, 2, Long.MAX_VALUE})
    public void testCSVParsingWithRowLimit(long rowLimit) throws Exception {
        // Step 0: Prepare a text source containing three rows of comma-separated values with three columns each
        String textSource = TEXT_SOURCE;

        // Step 1: Configure the data processing system to use standard comma-separated formatting
        // Fixed: Use a single CSVFormat configuration that includes both the delimiter and the row limit
        CSVFormat format = CSVFormat.Builder.create()
                .withDelimiter(',')
                .setMaxRows(rowLimit)
                .build();

        // Step 2: Set the row limit (already included in the format above)
        // Step 3: Initiate data retrieval by streaming records from the configured source
        CSVParser parser = CSVParser.parse(textSource, format);
        List<CSVRecord> records = parser.getRecords();

        // Step 4: Verify the system returned at least one row
        assertThat(records).isNotEmpty();

        // Step 5: Confirm the first row contains the expected values from the initial line of input
        assertThat(records.get(0).get(0)).isEqualTo("value1");
        assertThat(records.get(0).get(1)).isEqualTo("value2");
        assertThat(records.get(0).get(2)).isEqualTo("value3");

        // Step 6: Validate that the second row is present and contains the expected values from the second line of input
        if (rowLimit <= 1) {
            assertThat(records).hasSize(1);
        } else {
            assertThat(records).hasSize(2);
            assertThat(records.get(1).get(0)).isEqualTo("value4");
            assertThat(records.get(1).get(1)).isEqualTo("value5");
            assertThat(records.get(1).get(2)).isEqualTo("value6");

            // Step 7: Ensure the third row is present and contains the expected values from the final line of input
            if (rowLimit <= 2) {
                assertThat(records).hasSize(2);
            } else {
                assertThat(records).hasSize(3);
                assertThat(records.get(2).get(0)).isEqualTo("value7");
                assertThat(records.get(2).get(1)).isEqualTo("value8");
                assertThat(records.get(2).get(2)).isEqualTo("value9");
            }
        }

        // Step 23: Release the data processing resources
        parser.close();
    }
}

