import static org.junit.jupiter.api.Assertions.*;

public class TokenTest1 {

    @ParameterizedTest
    @EnumSource(Token.Type.class)
    public void testTokenToStringWithParameterizedType(Token.Type parameterizedType) {
        // Step 0: Instantiate a new Token object
        Token token = new Token();

        // Step 1: Capture the name of the INVALID type constant
        String invalidTypeName = Token.Type.INVALID.name();

        // Step 2: Invoke the toString method on the token
        String initialString = token.toString();

        // Step 3: Assert that the resulting string contains the INVALID type name
        assertTrue(initialString.contains(invalidTypeName));

        // Step 4: Reset the token to its initial state
        token.reset();

        // Step 5: Invoke the toString method on the token after reset
        String resetString = token.toString();

        // Step 6: Assert that toString still includes the INVALID type name
        assertTrue(resetString.contains(invalidTypeName));

        // Step 7: Assign null to the token's type field
        token.type = null;

        // Step 8: Invoke the toString method on the token with null type
        String nullTypeString = token.toString();

        // Step 9: Assert that the toString output is not empty
        assertNotNull(nullTypeString);
        assertFalse(nullTypeString.isEmpty());

        // Step 10: Reset the token again to restore its default state
        token.reset();

        // Step 11: Assign the parameterized type value to the token's type field
        token.type = parameterizedType;

        // Step 12: Invoke the toString method on the token with assigned type
        String assignedTypeString = token.toString();

        // Step 13: Assert that toString now contains the name of the assigned type
        assertTrue(assignedTypeString.contains(parameterizedType.name()));

        // Step 14: Modify the token's internal content buffer by setting its length to one thousand characters
        token.content.setLength(1000);

        // Step 15: Invoke the toString method on the token with large content
        String largeContentString = token.toString();

        // Step 16: Assert that toString continues to include the assigned type name
        assertTrue(largeContentString.contains(parameterizedType.name()));
    }
}

