package org.apache.commons.csv;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Assertions;
import java.io.IOException;

public class CSVFormatTest1 {

    @Test
    public void testHeaderValidation() {
        // Step 0: Configure the parser to use the first character of the input as the value separator
        String inputData = "data,without,headers";
        char firstCharOfInput = inputData.charAt(0);
        CSVFormat configuredParser = CSVFormat.DEFAULT.withDelimiter(firstCharOfInput);

        // Step 1: Enable automatic header detection without explicitly naming columns
        CSVFormat parserWithAutoHeaders = configuredParser.withFirstRecordAsHeader();

        // Step 2: Activate the setting to skip the header row during processing
        CSVFormat parserWithSkipHeader = parserWithAutoHeaders.withSkipHeaderRecord(true);

        // Step 3: Apply trimming of surrounding whitespace
        CSVFormat parserWithTrim = parserWithSkipHeader.withTrim(true);

        // Step 4: Enforce the presence of headers and raise a validation error if they are missing
        CSVFormat finalParser = parserWithTrim.withAllowMissingColumnNames(false);

        // Step 5: Provide input data without column headers
        String inputDataWithoutHeaders = "value1,value2,value3";

        // Step 6: Attempt to initiate the parsing operation with the provided input data
        // Step 7: Verify the system raises a validation error indicating missing header information
        Assertions.assertThrows(IllegalArgumentException.class, () -> {
            CSVParser.parse(inputDataWithoutHeaders, finalParser);
        });

        // Step 8: Clean up test resources (no specific cleanup required)
    }
}

